import React from 'react';
 import VedioItem from './VediosItems';

const VedioList = ({ vedios }) =>{
   const renderList = vedios.map((vedio) =>{
    return (
      <div className='ui relaxed divided list'>
    <VedioItem vedio ={vedio} />
    </div>
    )
  }
  )
  return(
    <div>{renderList } 
    </div>
  )
} 

export default VedioList;
